import PropTypes from 'prop-types';
import { Friendlist, Item, Status, Username, Avatar } from './Friendlist.styled';
import { checkOnline } from './checkIsOnline';

export const FriendList = ({props}) => {
    return (
        <Friendlist>
            {props.map(({ avatar, name, isOnline, id }) => (
    <Item >
    <Status>{`${checkOnline(isOnline)}`}</Status>
    <Avatar src={avatar} alt={name} width="48" />
    <Username>{name}</Username>
    </Item>
            ))             
            }
        </Friendlist>)
}
